import {Container ,Row,Button} from 'reactstrap'
import { NavLink,Link } from "react-router-dom";

const nav_links=[
  {
    path:'/home',
    display:'home'
  },
  {
    path:'#',
    display:'About'
  },
  {
    path:'/hom',
    display:'home'
  },
]

function Header() {
  return (
    <div>Header</div>
  )
}

export default Header
